This clash is easy to understand and solve in under 5 minutes. This problem is also quite interesting. Here's my solution to the problem (probably can be shortened): 

n = int(input())
directory = {}
for i in range(n):
    inputs = input().split()
    key = inputs[0]
    value = inputs[1]
    if key[0] in directory:
        directory[key[0]] = key+"="+value
    else:
        directory.update({key[0]: key+"="+value})
for i,j in directory.items():
    print(i+":",j)

